Patch Set 25:

(3 comments)

@Lakshmi: You are right. It's a bug indeed that in some cases the old object name come lowercased. I've fixed it for objects, namespaces, tags and properties. Thanks.

@Nikhil: Right. I've refactored the old classes for image/task notifications to make them consistent with the rest of the code and to make it easier for future contribution for adding new notifications for resources. But we can't simply get rid of these changes and revert them to the old implementation, because we are introducing `disabled_notifications` flag in this bp also. We should respect this flag on image/task notifications, so still need to modify existing code somehow to use that new method _send_notification. I can try to revert most of the changes for existing code and put only required piece of code. Thoughts?
